const Card = styled.div`
    height: 400px;
    width: 400px;
    border-radius: 1rem;
    background: #053868;
`


const Insights = function(){
    return(
        <div className="box-wrapper">
            <Card></Card>
            <Card></Card>
            <Card></Card>
            <Card></Card>
        </div>
    );
}

export default Insights;
